import{_ as r}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as a,b as t}from"./app-dd3ac8f0.js";const o={},d=t('<h1 id="数据结构" tabindex="-1"><a class="header-anchor" href="#数据结构" aria-hidden="true">#</a> 数据结构</h1><h2 id="第01章-简介" tabindex="-1"><a class="header-anchor" href="#第01章-简介" aria-hidden="true">#</a> 第01章 简介</h2><p>程序 = 数据结构(Data Structure) + 算法</p><p>这个公式对计算机科学的影响程度足以类似于物理学中爱因斯坦的质能方程。<br> 数据结构是一种组织和存储数据的方式。以便能够有效地访问和修改数据。数据结构是计算机科学中的一个重要概念，它关注如何组织和管理数据，以便能够高效地执行各种操作，如搜索、排序、插入和删除等。</p><h2 id="第02章-基本结构" tabindex="-1"><a class="header-anchor" href="#第02章-基本结构" aria-hidden="true">#</a> 第02章 基本结构</h2><p>数据元素不是孤立存在的，他们之间存在着某种关系，数据元素相互之间的关系称为结构。数据结构是带结构的数据元素的集合。</p><p>数据结构分为线性结构和非线性结构。<br> 线性结构：线性表，栈和队列，串，数组和广义表<br> 非线性结构：树，图</p><h2 id="第03章-基本概念和术语" tabindex="-1"><a class="header-anchor" href="#第03章-基本概念和术语" aria-hidden="true">#</a> 第03章 基本概念和术语</h2><p><b style="color:#3e547d;"><strong>数据</strong></b><br> 是能够输入计算机且能被计算机处理的各种符号的集合。包括数值型的数据如整数实数等以及非数值型的数据如文字图像图形声音等。<br><b style="color:#3e547d;"><strong>数据元素</strong></b><br> 是数据的基本单位，在计算机程序中通常作为一个整体进行考虑和处理。也简称为元素，或记录，结点或顶点。如一名学生的基本信息包括姓名，性别，年龄，住址，出生日期。由这五项组成的一个整体就叫做数据元素。<br><b style="color:#3e547d;"><strong>数据项</strong></b><br> 构成数据元素的不可分割的最小单位<br> 如学生基本信息中的姓名，性别，年龄，住址，出生日期中的性别这项就叫数据项。<br><b style="color:#3e547d;"><strong>数据对象</strong></b><br> 是性质相同的数据元素的集合，是数据的一个子集。<br> 例如整数的数据对象是集合N = 0 1 -1 2 -2 ......</p><h2 id="第04章-算法和算法分析" tabindex="-1"><a class="header-anchor" href="#第04章-算法和算法分析" aria-hidden="true">#</a> 第04章 算法和算法分析</h2><p>算法就是对特定问题求解方法和步骤的一种描述，它是指令的有限序列。</p><p>算法的五个特性：输入 输出 有穷性 确定性 可行性</p><p>算法的设计要求：正确性 可读性 健壮性 高效性</p>',13),n=[d];function s(h,c){return e(),a("div",null,n)}const l=r(o,[["render",s],["__file","数据结构.html.vue"]]);export{l as default};
